        ,\"body\":\"- Fixed a bug where fzf incorrectly display the lines when straddling\
        \ tab\\n  characters are trimmed\\n- Placeholder expression used in `--preview`\
        \ and `execute` action can\\n  optionally take `+` flag to be used with multiple\
        \ selections\\n  - e.g. `git log --oneline | fzf --multi --preview 'git show\
        \ {+1}'`\\n- Added `execute-silent` action for executing a command silently\
        \ without\\n  switching to the alternate screen. This is useful when the process\
        \ is\\n  short-lived and you're not interested in its output.\\n  - e.g. `fzf\
        \ --bind 'ctrl-y:execute!(echo -n {} | pbcopy)'`\\n- `ctrl-space` is allowed\
        \ in `--bind`\\n\"},{\"url\":\"https://api.github.com/repos/junegunn/fzf-bin/releases/5240103\"\
