        ,\"body\":\"- Added support for range expression in preview and execute action\\\
        n  - e.g. `ls -l | fzf --preview=\\\"echo user={3} when={-4..-2}; cat {-1}\\\
        \" --header-lines=1`\\n  - `{q}` will be replaced to the single-quoted string\
        \ of the current query\\n- Fixed to properly handle unicode whitespace characters\\\
        n- Display scroll indicator in preview window\\n- Inverse search term will\
        \ use exact matcher by default\\n  - This is a breaking change, but I believe\
        \ it makes much more sense. It is\\n    almost impossible to predict which\
        \ entries will be filtered out due to\\n    a fuzzy inverse term. You can\
        \ still perform inverse-fuzzy-match by\\n    prepending `!'` to the term.\\\
        n\\n<img width=\\\"1280\\\" alt=\\\"fzf-0 15 4\\\" src=\\\"https://cloud.githubusercontent.com/assets/700826/19046441/56ff268e-89d8-11e6-9c38-72175940803b.png\\\
